 None:\n        start_time = time.time()\n        sfm_result_graph = self.scene_optimizer.create_computation_graph(\n            num_images=len(self.loader),\n            image_pair_indices=self.loader.get_valid_pairs(),\n            image_graph=self.loader.create_computation_graph_for_images(),\n            camera_intrinsics_graph=self.loader.create_computation_graph_for_intrinsics(),\n            image_shape_graph=self.loader.create_computation_graph_for_image_shapes(),\n            gt_cameras_graph=self.loader.create_computation_graph_for_cameras(),\n        )\n\n        # create dask client\n        cluster = LocalCluster(\n            n_workers=self.parsed_args.num_workers, threads_per_worker=self.parsed_args.threads_per_worker\n        )\n\n        with Client(cluster), performance_report(filename=\"dask-report.html\"):\n            sfm_result = sfm_result_graph.compute()\n\n        assert isinstance(sfm_result, GtsfmData)\n\n        end_time = time.time()\n        duration_sec = end_time - start_time\n        logger.info(\"GTSFM took %.2f minutes to compute sparse multi-view result.\", duration_sec / 60)\n\n        &lt;/pre&gt;\n        "},"id":"1390","type":"Div"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Clear task state&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO -   Scheduler at:     tcp://127.0.0.1:35463&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO -   dashboard at:            127.0.0.1:8787&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Register worker &amp;lt;WorkerState &
